import {Component} from '@angular/core';

interface PlayerRm {
  id: number;
  email: string;
  passwordHash: string;
  name: string;
  phoneNumber: string;
  dateOfRegistration: string;
}

class Player implements PlayerRm {
  public static readonly NONE_EMAIL = "[none_email]"
  public static readonly NONE_HASH = "[none_hash]"
  public static readonly NONE_NAME = "[none_name]";
  public static readonly NONE_PHONE_NUMBER = "[none_phone_number]";
  public static readonly NONE_DATE_OF_REGISTRATION = "[none_date_of_registration]";

  readonly id = -1;
  readonly email = Player.NONE_EMAIL;
  readonly passwordHash = Player.NONE_HASH;
  readonly name = Player.NONE_NAME;
  readonly phoneNumber = Player.NONE_PHONE_NUMBER;
  readonly dateOfRegistration = Player.NONE_DATE_OF_REGISTRATION;
}

